import React from "react";
import "./Header.css";

importScripts (<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css" integrity="sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm" crossorigin="anonymous"></link>)
function Header() {
  return (
    <div class="jumbotron">
  <h1 class="display-4">Clicky Game</h1>
</div>
  );
}

export default Header;
